import os
import uuid
import images

from PyQt5.QtCore import QByteArray, QSize, Qt
from PyQt5.QtGui import QPixmap, QIcon, QImage, QTextDocument, QFont, QKeySequence
from PyQt5.QtPrintSupport import QPrintDialog
from PyQt5.QtWidgets import QTextEdit, QMainWindow, QVBoxLayout, QWidget, QStatusBar, QToolBar, QAction, \
    QFontComboBox, QComboBox, QActionGroup, QMessageBox, QFileDialog


FONT_SIZES = [7, 8, 9, 10, 11, 12, 13, 14, 18, 24, 36, 48, 64, 72, 96, 144, 288]
IMAGE_EXTENSIONS = ['.jpg', '.png', '.bmp']
HTML_EXTENSIONS = ['.htm', '.html']


def hexuuid():
    return uuid.uuid4().hex


def splitext(p):
    return os.path.splitext(p)[1].lower()


def icon_from_base64(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    icon = QIcon(pixmap)
    return icon


class TextEdit(QTextEdit):
    def canInsertFromMimeData(self, source):
        if source.hasImage():
            return True
        else:
            return super(TextEdit, self).canInsertFromMimeData(source)

    def insertFromMimeData(self, source):
        cursor = self.textCursor()
        document = self.document()
        if source.hasUrls():
            for u in source.urls():
                file_ext = splitext(str(u.toLocalFile()))
                if u.isLocalFile() and file_ext in IMAGE_EXTENSIONS:
                    image = QImage(u.toLocalFile())
                    document.addResource(QTextDocument.ImageResource, u, image)
                    cursor.insertImage(u.toLocalFile())
                else:
                    # If we hit a non-image or non-local URL break the loop and fall out
                    # to the super call & let Qt handle it
                    break
            else:
                # If all were valid images, finish here.
                return
        elif source.hasImage():
            image = source.imageData()
            u_uid = hexuuid()
            document.addResource(QTextDocument.ImageResource, u_uid, image)
            cursor.insertImage(u_uid)
            return
        super(TextEdit, self).insertFromMimeData(source)


class UI(QMainWindow):
    def __init__(self, *args, **kwargs):
        super(UI, self).__init__(*args, **kwargs)
        img_b64 = b''
        icon = icon_from_base64(img_b64)
        self.setWindowIcon(icon)
        self.setWindowTitle(u"文本编辑器")
        self.resize(716, 560)
        layout = QVBoxLayout()
        self.editor = TextEdit()
        # Setup the QTextEdit editor configuration
        self.editor.setAutoFormatting(QTextEdit.AutoAll)
        self.editor.selectionChanged.connect(self.update_format)
        self.editor.textChanged.connect(self.update_title_for_change)
        # Initialize default font size.
        font = QFont('Times', 12)
        self.editor.setFont(font)
        # We need to repeat the size to init the current format.
        self.editor.setFontPointSize(12)

        # self.path holds the path of the currently open file.
        # If none, we haven't got a file open yet (or creating new).
        self.path = None

        layout.addWidget(self.editor)

        container = QWidget()
        container.setLayout(layout)
        self.setCentralWidget(container)

        self.status = QStatusBar()
        self.setStatusBar(self.status)

        # Uncomment to disable native menubar on Mac
        # self.menuBar().setNativeMenuBar(False)

        file_toolbar = QToolBar(u"文件")
        file_toolbar.setIconSize(QSize(14, 14))
        self.addToolBar(file_toolbar)
        file_menu = self.menuBar().addMenu(u"&文件")

        open_file_action = QAction(icon_from_base64(images.BLUE_FOLDER_OPEN_DOCUMENT), u"打开...", self)
        open_file_action.setStatusTip(u"打开文件")
        open_file_action.triggered.connect(self.file_open)
        file_menu.addAction(open_file_action)
        file_toolbar.addAction(open_file_action)

        save_file_action = QAction(icon_from_base64(images.DISK), u"保存", self)
        save_file_action.setStatusTip(u"保存当前页")
        save_file_action.triggered.connect(self.file_save)
        file_menu.addAction(save_file_action)
        file_toolbar.addAction(save_file_action)

        saveas_file_action = QAction(icon_from_base64(images.DISK__PENCIL), u"另存为...", self)
        saveas_file_action.setStatusTip(u"另存当前页为指定文件")
        saveas_file_action.triggered.connect(self.file_saveas)
        file_menu.addAction(saveas_file_action)
        file_toolbar.addAction(saveas_file_action)

        print_action = QAction(icon_from_base64(images.PRINTER), u"打印...", self)
        print_action.setStatusTip(u"打印当前页")
        print_action.triggered.connect(self.file_print)
        file_menu.addAction(print_action)
        file_toolbar.addAction(print_action)

        edit_toolbar = QToolBar(u"编辑")
        edit_toolbar.setIconSize(QSize(16, 16))
        self.addToolBar(edit_toolbar)
        edit_menu = self.menuBar().addMenu(u"&编辑")

        undo_action = QAction(icon_from_base64(images.ARROW_CURVE_180_LEFT), u"撤销", self)
        undo_action.setStatusTip(u"撤销最后一次操作")
        undo_action.triggered.connect(self.editor.undo)
        edit_menu.addAction(undo_action)

        redo_action = QAction(icon_from_base64(images.ARROW_CURVE), u"重做", self)
        redo_action.setStatusTip(u"重做最后一次操作")
        redo_action.triggered.connect(self.editor.redo)
        edit_toolbar.addAction(redo_action)
        edit_menu.addAction(redo_action)

        edit_menu.addSeparator()

        cut_action = QAction(icon_from_base64(images.SCISSORS), u"剪切", self)
        cut_action.setStatusTip(u"剪切选定文本")
        cut_action.setShortcut(QKeySequence.Cut)
        cut_action.triggered.connect(self.editor.cut)
        edit_toolbar.addAction(cut_action)
        edit_menu.addAction(cut_action)

        copy_action = QAction(icon_from_base64(images.DOCUMENT_COPY), u"复制", self)
        copy_action.setStatusTip(u"复制选定文本")
        cut_action.setShortcut(QKeySequence.Copy)
        copy_action.triggered.connect(self.editor.copy)
        edit_toolbar.addAction(copy_action)
        edit_menu.addAction(copy_action)

        paste_action = QAction(icon_from_base64(images.CLIPBOARD_PASTE_DOCUMENT_TEXT), u"粘贴", self)
        paste_action.setStatusTip(u"从剪贴板粘贴")
        cut_action.setShortcut(QKeySequence.Paste)
        paste_action.triggered.connect(self.editor.paste)
        edit_toolbar.addAction(paste_action)
        edit_menu.addAction(paste_action)

        select_action = QAction(icon_from_base64(images.SELECTION_INPUT), u"全选", self)
        select_action.setStatusTip(u"选择全部文本")
        cut_action.setShortcut(QKeySequence.SelectAll)
        select_action.triggered.connect(self.editor.selectAll)
        edit_menu.addAction(select_action)

        edit_menu.addSeparator()

        wrap_action = QAction(icon_from_base64(images.ARROW_CONTINUE), u"自动换行", self)
        wrap_action.setStatusTip(u"窗体中的文本自动换行")
        wrap_action.setCheckable(True)
        wrap_action.setChecked(True)
        wrap_action.triggered.connect(self.edit_toggle_wrap)
        edit_menu.addAction(wrap_action)

        format_toolbar = QToolBar(u"格式")
        format_toolbar.setIconSize(QSize(16, 16))
        self.addToolBar(format_toolbar)
        format_menu = self.menuBar().addMenu(u"&格式")

        # We need references to these actions/settings to update as selection
        # changes, so attach to self.
        self.fonts = QFontComboBox()
        self.fonts.currentFontChanged.connect(self.editor.setCurrentFont)
        format_toolbar.addWidget(self.fonts)

        self.fontsize = QComboBox()
        self.fontsize.addItems([str(s) for s in FONT_SIZES])

        # Connect to the signal producing the text of the current selection. Convert the string to float
        # and set as the pointsize. We could also use the index + retrieve from
        # FONT_SIZES.
        self.fontsize.currentIndexChanged[str].connect(
            lambda s: self.editor.setFontPointSize(float(s)))
        format_toolbar.addWidget(self.fontsize)

        self.bold_action = QAction(icon_from_base64(images.EDIT_BOLD), u"加粗", self)
        self.bold_action.setStatusTip(u"将文本加粗")
        self.bold_action.setShortcut(QKeySequence.Bold)
        self.bold_action.setCheckable(True)
        self.bold_action.toggled.connect(
            lambda x: self.editor.setFontWeight(
                QFont.Bold if x else QFont.Normal))
        format_toolbar.addAction(self.bold_action)
        format_menu.addAction(self.bold_action)

        self.italic_action = QAction(icon_from_base64(images.EDIT_ITALIC), u"倾斜", self)
        self.italic_action.setStatusTip(u"将文字变为斜体")
        self.italic_action.setShortcut(QKeySequence.Italic)
        self.italic_action.setCheckable(True)
        self.italic_action.toggled.connect(self.editor.setFontItalic)
        format_toolbar.addAction(self.italic_action)
        format_menu.addAction(self.italic_action)

        self.underline_action = QAction(icon_from_base64(images.EDIT_UNDERLINE), u"下划线", self)
        self.underline_action.setStatusTip(u"为文字添加下划线")
        self.underline_action.setShortcut(QKeySequence.Underline)
        self.underline_action.setCheckable(True)
        self.underline_action.toggled.connect(self.editor.setFontUnderline)
        format_toolbar.addAction(self.underline_action)
        format_menu.addAction(self.underline_action)

        format_menu.addSeparator()

        self.alignl_action = QAction(icon_from_base64(images.EDIT_ALIGNMENT), u"左对齐", self)
        self.alignl_action.setStatusTip(u"将内容与左边距对齐。左对齐通常用于正文文本，使文档更易于阅读。")
        self.alignl_action.setCheckable(True)
        self.alignl_action.triggered.connect(
            lambda: self.editor.setAlignment(Qt.AlignLeft))
        format_toolbar.addAction(self.alignl_action)
        format_menu.addAction(self.alignl_action)

        self.alignc_action = QAction(icon_from_base64(images.EDIT_ALIGNMENT_CENTER), u"居中", self)
        self.alignc_action.setStatusTip(u"使内容在页面上居中对齐。居中对齐为文档提供正式的外观，通常用于封面、引言，"
                                        u"有时用于标题。")
        self.alignc_action.setCheckable(True)
        self.alignc_action.triggered.connect(
            lambda: self.editor.setAlignment(Qt.AlignCenter))
        format_toolbar.addAction(self.alignc_action)
        format_menu.addAction(self.alignc_action)

        self.alignr_action = QAction(icon_from_base64(images.EDIT_ALIGNMENT_RIGHT), u"右对齐", self)
        self.alignr_action.setStatusTip(u"将内容与右边距对齐。向右对齐用于一小部分内容(例如，页眉或页脚中的文本)。")
        self.alignr_action.setCheckable(True)
        self.alignr_action.triggered.connect(
            lambda: self.editor.setAlignment(Qt.AlignRight))
        format_toolbar.addAction(self.alignr_action)
        format_menu.addAction(self.alignr_action)

        self.alignj_action = QAction(icon_from_base64(images.EDIT_ALIGNMENT_JUSTIFY), u"两端对齐", self)
        self.alignj_action.setStatusTip(u"在边距之间均匀分布文本。排列整齐的文本使您的文档整洁干净，看起来更加优雅。")
        self.alignj_action.setCheckable(True)
        self.alignj_action.triggered.connect(
            lambda: self.editor.setAlignment(Qt.AlignJustify))
        format_toolbar.addAction(self.alignj_action)
        format_menu.addAction(self.alignj_action)

        format_group = QActionGroup(self)
        format_group.setExclusive(True)
        format_group.addAction(self.alignl_action)
        format_group.addAction(self.alignc_action)
        format_group.addAction(self.alignr_action)
        format_group.addAction(self.alignj_action)

        format_menu.addSeparator()

        # A list of all format-related widgets/actions, so we can
        # disable/enable signals when updating.
        self._format_actions = [
            self.fonts,
            self.fontsize,
            self.bold_action,
            self.italic_action,
            self.underline_action,
            # We don't need to disable signals for alignment, as they are
            # paragraph-wide.
        ]

        # Initialize.
        self.update_format()
        self.update_title()
        self.show()

    def block_signals(self, objects, b):
        for o in objects:
            o.blockSignals(b)

    def update_format(self):
        """
        Update the font format toolbar/actions when a new text selection is made. This is neccessary to keep
        toolbars/etc. in sync with the current edit state.
        """
        # Disable signals for all format widgets, so changing values here does
        # not trigger further formatting.
        self.block_signals(self._format_actions, True)

        self.fonts.setCurrentFont(self.editor.currentFont())
        # Nasty, but we get the font-size as a float but want it was an int
        self.fontsize.setCurrentText(str(int(self.editor.fontPointSize())))

        self.italic_action.setChecked(self.editor.fontItalic())
        self.underline_action.setChecked(self.editor.fontUnderline())
        self.bold_action.setChecked(self.editor.fontWeight() == QFont.Bold)

        self.alignl_action.setChecked(self.editor.alignment() == Qt.AlignLeft)
        self.alignc_action.setChecked(
            self.editor.alignment() == Qt.AlignCenter)
        self.alignr_action.setChecked(self.editor.alignment() == Qt.AlignRight)
        self.alignj_action.setChecked(
            self.editor.alignment() == Qt.AlignJustify)

        self.block_signals(self._format_actions, False)

    def dialog_critical(self, s):
        dlg = QMessageBox(self)
        dlg.setText(s)
        dlg.setIcon(QMessageBox.Critical)
        dlg.show()

    def file_open(self):
        path, _ = QFileDialog.getOpenFileName(self, u"打开", "", u"文本文件(*.txt);;HTML文件(*.html);;所有文件(*.*)")
        if not path:
            # If dialog is cancelled, will return ''
            return
        try:
            with open(path, 'r') as f:
                text = f.read()
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            # Qt will automatically try and guess the format as txt/html
            self.editor.setText(text)
            self.update_title()

    def file_save(self):
        if self.path is None:
            # If we do not have a path, we need to use Save As.
            return self.file_saveas()
        text = self.editor.toHtml() if splitext(
            self.path) in HTML_EXTENSIONS else self.editor.toPlainText()
        try:
            with open(self.path, 'w') as f:
                f.write(text)
            self.update_title()
        except Exception as e:
            self.dialog_critical(str(e))

    def file_saveas(self):
        path, _ = QFileDialog.getSaveFileName(self, u"保存", "", u"文本文件(*.txt);;HTML文件(*.html);;所有文件(*.*)")
        if not path:
            # If dialog is cancelled, will return ""
            return
        text = self.editor.toHtml() if splitext(
            path) in HTML_EXTENSIONS else self.editor.toPlainText()
        try:
            with open(path, 'w') as f:
                f.write(text)
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            self.update_title()

    def file_print(self):
        dlg = QPrintDialog()
        if dlg.exec_():
            self.editor.print_(dlg.printer())

    def update_title(self):
        self.setWindowTitle(u"%s - 文本编辑器" % (os.path.basename(self.path) if self.path else "Untitled"))

    def update_title_for_change(self):
        self.setWindowTitle(u"* %s - 文本编辑器" % (os.path.basename(self.path) if self.path else "Untitled"))

    def edit_toggle_wrap(self):
        self.editor.setLineWrapMode(
            QTextEdit.WidgetWidth if self.editor.lineWrapMode() == QTextEdit.NoWrap else QTextEdit.NoWrap)
